sys_ux_client_script.script:
/**
  * @param {params} params
  * @param {api} params.api
  * @param {TransformApiHelpers} params.helpers
  */
function evaluateProperty({api, helpers}) {
  const [selectedCameraId] = api.state.selectedCameraIds;
  const {cameraDeviceId} = api.state.photoboothSettings;
	return selectedCameraId && (cameraDeviceId != selectedCameraId);
}
